import React from "react";
import CardExtras from '../CardExtras'
import { SubtitleCont, ContentSection, Container } from "./styles";

const CardExtraScreen= () =>{
    return(
        <ContentSection>
            <Container>
                <SubtitleCont><b>Extracurriculares</b></SubtitleCont>
                <CardExtras title = "ADA - Projetos em Engenharia de Computação" text = "Parabéns por ter entrado no melhor curso de Engenharia de Computação do Brasil!Se você quer desde o início do curso trabalhar em projetos reais onde você pode aplicar conhecimentos vistos em sala de aula, venha participar da ADA!<br>
                A ADA  é o grupo que realiza projetos no escopo do nosso curso e tem como objetivo proporcionar o aprendizado e o crescimento dos alunos do campus por meio da solução de problemas utilizando o conhecimento de Engenharia de Computação.<br>
                O grupo foi criado por pessoas da Eng Comp, então sabemos como as coisas funcionam. Para participar não precisa ter nenhum conhecimento prévio em eletrônica ou programação, contamos apenas com sua vontade de aprender e sua determinação!<br>
                Venha fazer parte desse incrível grupo e tornar sua experiência no CAASO ainda melhor!" url = "img1"></CardExtras>
                <CardExtras title = "Oi" text = "teste" url = "img2"></CardExtras>
            </Container>
        </ContentSection>
    )

}
export default CardExtraScreen;
